import React from 'react';
import './FloatingCharacter.css';

const FloatingCharacter = () => {
  return (
    <div className="spider-container">
      <svg className="spider" viewBox="0 0 100 100">
        {/* Abdomen - oval, main body (opisthosoma) */}
        <ellipse cx="50" cy="58" rx="15" ry="24" fill="#1a1a1a" stroke="#0d0d0d" strokeWidth="0.5" />
        
        {/* Cephalothorax - head-thorax (smaller, darker) */}
        <ellipse cx="50" cy="20" rx="12" ry="10" fill="#2c2c2c" stroke="#0d0d0d" strokeWidth="0.5" />
        
        {/* Eyes - 8 mắt như nhện thực */}
        <circle cx="44" cy="17" r="1.5" fill="#ff6b00" opacity="0.9" />
        <circle cx="56" cy="17" r="1.5" fill="#ff6b00" opacity="0.9" />
        <circle cx="42" cy="24" r="1" fill="#ff8c00" opacity="0.7" />
        <circle cx="58" cy="24" r="1" fill="#ff8c00" opacity="0.7" />
        <circle cx="46" cy="27" r="0.8" fill="#ffa500" opacity="0.5" />
        <circle cx="54" cy="27" r="0.8" fill="#ffa500" opacity="0.5" />
        
        {/* Pedicel - connector */}
        <line x1="50" y1="30" x2="50" y2="34" stroke="#1a1a1a" strokeWidth="1" />
        
        {/* Spinnerets - rear indicator */}
        <circle cx="48" cy="80" r="0.8" fill="#2c2c2c" opacity="0.6" />
        <circle cx="52" cy="80" r="0.8" fill="#2c2c2c" opacity="0.6" />
        
        {/* Front Left Leg 1 - nâng trước, bước dài */}
        <g className="leg-group leg-1">
          <path className="leg-segment" d="M 38 22 L 20 12 L 10 8 L 3 6" stroke="#1a1a1a" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Front Left Leg 2 */}
        <g className="leg-group leg-2">
          <path className="leg-segment" d="M 36 30 L 18 28 L 6 26 L 1 25" stroke="#1a1a1a" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Front Right Leg 1 */}
        <g className="leg-group leg-5">
          <path className="leg-segment" d="M 62 22 L 80 12 L 90 8 L 97 6" stroke="#1a1a1a" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Front Right Leg 2 */}
        <g className="leg-group leg-6">
          <path className="leg-segment" d="M 64 30 L 82 28 L 94 26 L 99 25" stroke="#1a1a1a" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Back Left Leg 1 - nâng sau, bước xuống */}
        <g className="leg-group leg-3">
          <path className="leg-segment" d="M 40 65 L 25 78 L 12 88 L 4 95" stroke="#1a1a1a" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Back Left Leg 2 */}
        <g className="leg-group leg-4">
          <path className="leg-segment" d="M 42 78 L 28 88 L 18 96 L 8 102" stroke="#1a1a1a" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Back Right Leg 1 */}
        <g className="leg-group leg-7">
          <path className="leg-segment" d="M 60 65 L 75 78 L 88 88 L 96 95" stroke="#1a1a1a" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Back Right Leg 2 */}
        <g className="leg-group leg-8">
          <path className="leg-segment" d="M 58 78 L 72 88 L 82 96 L 92 102" stroke="#1a1a1a" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
      </svg>
    </div>
  );
};

export default FloatingCharacter;
